import React, { useState } from 'react';
import { makeStyles } from '@mui/styles';
import {
  TextField,
  Card,
  CardContent,
  Box,
  Typography,
  Button,
  Stack,
  IconButton,
  useTheme,
  useMediaQuery,
} from '@mui/material';
import EditIcon from '@mui/icons-material/Edit';
import DeleteIcon from '@mui/icons-material/Delete';
import background from '../assets/backdrop.jpg';

const useStyles = makeStyles((theme) => ({
  root: {
    backgroundColor: '#ff5252',
    color: 'white',
    padding: '1rem',
    width: '30%',
    height: '70vh',
    boxShadow: '5px 5px 25px -5px rgba(0,0,0,0.5)',
    borderRadius: 0,
    margin: 'auto',
    textAlign: 'left',
    alignItems: 'center',
    justifyContent: 'space-between',
    position: 'relative',
    [theme.breakpoints.down('sm')]: {
      width: '40%',
    },
    [theme.breakpoints.up('lg')]: {
      width: '30%',
    },
  },
  heading: {
    ml: '50px',
    mt: '15px',
    fontWeight: 'bold',
  },
  subheading: {
    marginLeft: '60px',
    mb: '15px',
    fontWeight: 'bold',
  },
  hr: {
    margin: 'center',
    marginInlineStart: '7%',
    marginInlineEnd: '7%',
  },
  card: {
    background: '#ff5252',
    maxHeight: '300px',
    overflowY: 'auto',
  },
  cardContent: {
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'space-between',
    background: 'rgba(255, 205, 210, 0.25)',
  },
  newTodo: {
    position: 'absolute',
    bottom: '50px',
    width: '100%',
    flexDirection: 'column',
    marginLeft: '60px',
    marginRight: '50px',
    overflowY: 'auto',
  },
  todoHeading: {
    mb: '5px',
    fontWeight: 'bold',
  },
  todoContainer: {
    gap: '0.4rem',
    marginRight: '60px',
    display: 'flex',
  },
  todoTextField: {
    width: '60%',
    fontWeight: 'bold',
    borderRadius: 0,
    '& .MuiOutlinedInput-root': {
      backgroundColor: 'white',
      '&:hover fieldset': {
        borderColor: 'white',
      },
      '&.Mui-focused fieldset': {
        borderColor: '#ff5252',
      },
    },
    [theme.breakpoints.down('sm')]: {
      width: '50%',
    },
  },
  todoButton: {
    backgroundColor: '#ff5252',
    borderColor: 'white',
    color: 'white',
    fontWeight: 'bold',
    borderRadius: 0,
    '&:hover': {
      backgroundColor: 'black',
    },
    '&:focus': {
      outlineColor: '#ff5252',
    },
    [theme.breakpoints.down('sm')]: {
      width: '100%',
    },
  },
}));

function Todos(): JSX.Element {
  const theme = useTheme();
  const isSmallScreen = useMediaQuery(theme.breakpoints.down('sm'));
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <Box component="div">
        <Stack direction="column" sx={{ mb: '40px' }}>
          <Typography variant="h2" className={classes.heading}>
            Todo List
          </Typography>
          <Typography variant="subtitle1" className={classes.subheading}>
            A simple React Todo List App
          </Typography>
          <hr className={classes.hr} />
        </Stack>

        <Stack direction="column">
          <Card variant="outlined" className={classes.card}>
            <CardContent className={classes.cardContent}>
              <Typography
                variant="h5"
                component="h2"
                color="white"
                marginLeft="50px"
              >
                Task 1
              </Typography>
              <Box marginRight="50px">
                <IconButton aria-label="edit">
                  <EditIcon sx={{ color: 'white' }} />
                </IconButton>
                <IconButton aria-label="delele">
                  <DeleteIcon sx={{ color: 'white' }} />
                </IconButton>
              </Box>
            </CardContent>
          </Card>
        </Stack>
        <Stack direction="column" className={classes.newTodo}>
          <Typography variant="h6" className={classes.todoHeading}>
            New Todo
          </Typography>
          <Box className={classes.todoContainer}>
            <TextField
              label={
                <Typography variant="subtitle1" fontWeight="bold">
                  New Todo
                </Typography>
              }
              variant="outlined"
              font-Weight="bold"
              className={classes.todoTextField}
            />
            <Button
              variant="outlined"
              size="large"
              className={classes.todoButton}
            >
              Add Todo
            </Button>
          </Box>
        </Stack>
      </Box>
    </div>
  );
}

export default Todos;
